import React, { useState, useEffect } from "react";

export default function PupilManager() {
  const [pupils, setPupils] = useState([]);
  const [newPupil, setNewPupil] = useState({
    name: "",
    classname: "",
    year: "",
  });
  const API_URL = "http://localhost:3001/api/v1/pupils";

  // helper to get headers with token
  const authHeaders = () => {
    const token = localStorage.getItem("token");
    return {
      "Content-Type": "application/json",
      Authorization: `Bearer ${token}`,
    };
  };

  // Fetch pupils from API (protected)
  const fetchPupils = async () => {
    try {
      const res = await fetch(API_URL, {
        method: "GET",
        headers: authHeaders(),
      });

      if (res.status === 401) {
        console.error("Login required");
        return;
      }
      if (res.status === 403) {
        console.error("Invalid or expired token");
        return;
      }

      const data = await res.json();
      setPupils(data);
    } catch (err) {
      console.error("Error fetching pupils:", err);
    }
  };

  // Add new pupil
  const handleAdd = async (e) => {
    e.preventDefault();
    try {
      const res = await fetch(API_URL, {
        method: "POST",
        headers: authHeaders(),
        body: JSON.stringify(newPupil),
      });
      if (res.ok) {
        setNewPupil({ name: "", classname: "", year: "" });
        fetchPupils();
      } else {
        console.error("Failed to add pupil");
      }
    } catch (err) {
      console.error("Error adding pupil:", err);
    }
  };

  // Update specific field
  const handleUpdateField = async (id, field, value) => {
    if (value === null) return; // user pressed cancel in prompt
    try {
      const res = await fetch(`${API_URL}/${id}`, {
        method: "PUT",
        headers: authHeaders(),
        body: JSON.stringify({ [field]: value }),
      });
      if (res.ok) {
        fetchPupils();
      } else {
        console.error("Failed to update pupil");
      }
    } catch (err) {
      console.error("Error updating pupil:", err);
    }
  };

  // Delete pupil
  const handleDelete = async (id) => {
    try {
      const res = await fetch(`${API_URL}/${id}`, {
        method: "DELETE",
        headers: authHeaders(),
      });
      if (res.ok) {
        fetchPupils();
      } else {
        console.error("Failed to delete pupil");
      }
    } catch (err) {
      console.error("Error deleting pupil:", err);
    }
  };

  useEffect(() => {
    fetchPupils();
  }, []);

  return (
    <div>
      <h1>Pupil Manager</h1>

      {/* Add Pupil Form */}
      <form onSubmit={handleAdd}>
        <input
          type="text"
          placeholder="Name"
          value={newPupil.name}
          onChange={(e) => setNewPupil({ ...newPupil, name: e.target.value })}
          required
        />
        <input
          type="text"
          placeholder="Classname"
          value={newPupil.classname}
          onChange={(e) =>
            setNewPupil({ ...newPupil, classname: e.target.value })
          }
          required
        />
        <input
          type="number"
          placeholder="Year"
          value={newPupil.year}
          onChange={(e) => setNewPupil({ ...newPupil, year: e.target.value })}
          required
        />
        <button type="submit">Add Pupil</button>
      </form>

      {/* Pupils List */}
      <h2>Pupils List</h2>
      <ul>
        {pupils.map((pupil) => (
          <li key={pupil._id}>
            <div>
              <strong>{pupil.name}</strong> - {pupil.classname} - {pupil.year}
            </div>
            <div>
              <button
                onClick={() =>
                  handleUpdateField(
                    pupil._id,
                    "name",
                    prompt("New name:", pupil.name)
                  )
                }
              >
                Edit Name
              </button>
              <button
                onClick={() =>
                  handleUpdateField(
                    pupil._id,
                    "classname",
                    prompt("New classname:", pupil.classname)
                  )
                }
              >
                Edit Classname
              </button>
              <button
                onClick={() =>
                  handleUpdateField(
                    pupil._id,
                    "year",
                    prompt("New year:", pupil.year)
                  )
                }
              >
                Edit Year
              </button>
              <button onClick={() => handleDelete(pupil._id)}>Delete</button>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}
